import { Box } from "@mui/system";
import {
  FormLabel,
  TextField,
  FormControlLabel,
  Checkbox,
} from "@mui/material";
import Button from "@mui/material/Button";
import React from "react";

function AddBook() {
  return (
    <form>
      <Box
        display="flex"
        flexDirection="column"
        maxWidth={700}
        marginTop={10}
        marginLeft="auto"
        marginRight="auto"
      >
        <FormLabel>Name</FormLabel>
        <TextField fullWidth name="name" variant="outlined" />
        <FormLabel>Author</FormLabel>
        <TextField fullWidth name="author" variant="outlined" />
        <FormLabel>Description</FormLabel>
        <TextField fullWidth name="desc" variant="outlined" />
        <FormLabel>Price</FormLabel>
        <TextField type="number" fullWidth name="price" variant="outlined" />
        <FormLabel>Image</FormLabel>
        <TextField fullWidth name="image" variant="outlined" />
        <FormControlLabel
          control={<Checkbox checked={false} />}
          label="Available"
        />
        <Button variant="contained" type="submit">
          Add Book
        </Button>
      </Box>
    </form>
  );
}

export default AddBook;
